import React from "react";
import { Link, useNavigate } from "react-router-dom";
import axios from "axios";
import { useState, useEffect } from "react";
import { cloneElement } from "react";
import logonobr from "../logo no-background.png";
import logo from "../Logo.png";

const Orderdetail = () => {

    useEffect(() => {

        const fetchOrderData = async (Phone) => {
            try {
                const response = await axios.get(`http://localhost:3308/getorder/${Phone}`,);
                setOrder(response.data);
            } catch (error) {
                console.error('Error fetching data', error);
            }
        };

        const phoneformlocalstorage = localStorage.getItem('userInfo');
        if (phoneformlocalstorage) {
            const userInfo = JSON.parse(phoneformlocalstorage);
            setPhone(userInfo.phone);
            fetchCartData(userInfo.phone);
            fetchOrderData(userInfo.phone);
        }
    }, []);

    return (
        <body>
            <div class="container">
                <div className="header" style={{textAlign: "center", borderBottom: "2px solid #000" }} >
                    <img src={logonobr} alt="logo" height="130" width="130" style={{textAlign: "center"}}></img>
                </div>

                <section className="chuyentrang">
                    <div className="container pt-3">
                        <div className="row">
                            <nav aria-label="breadcrumb">
                                <ol className="breadcrumb">
                                    <li className="breadcrumb-item"><Link to={'/'} className="trangchu text-black">Trang chủ</Link></li>
                                    <li className="breadcrumb-item active" aria-current="page">Chi tiết đơn đặt hàng</li>
                                </ol>
                            </nav>
                        </div>
                    </div>
                </section>


                <hr className="container mt-4" ></hr>
                <div className="row">
                    <div className="col-md-6">
                        <strong>Thông tin khách hàng</strong>
                        <p>Họ và tên:</p>
                        <p>Email: </p>
                        <p>Số điện thoại:</p>
                        <p>Địa chỉ:</p>
                    </div>
                    <div className="col-md-6">
                        <strong>Thông tin đơn hàng</strong>
                        <p>Mã đơn hàng:</p>
                        <p>Ngày đặt hàng:</p>
                        <p>Nơi nhận:</p>
                        <p>Trạng thái:</p>
                    </div>
                </div>
                <hr></hr>
                
                <table className="table table-bordered" style={{textAlign: "center"}}>
                    <thead>
                        <tr>
                            <th>STT</th>
                            <th>Tên sản phẩm</th>
                            <th>Số lượng</th>
                            <th>Đơn giá</th>
                            <th>Thành tiền</th>
                        </tr>
                    </thead>
                    <tbody>
                        <tr>
                            <td>1</td>
                            <td></td>
                            <td></td>
                            <td></td>
                            <td></td>
                        </tr>
                        <tr>
                            <td>2</td>
                            <td></td>
                            <td></td>
                            <td></td>
                            <td></td>
                        </tr>
                    </tbody>
                </table>
                <hr></hr>
                <div className="row">
                    <div className="col-md-6">
                        <strong>Tổng tiền: [Tổng tiền]</strong>
                    </div>
                    <div className="col-md-6">
                        <a href="javascript:history.back()" className="btn btn-dark mt-2">Quay lại</a>
                    </div>
                </div>
                <hr></hr>
            </div>
        </body>
    );
}

export default Orderdetail;
